import "./nav.css";
import { Link } from "react-router-dom";


const Nav = () => {
        return ( 
                <div className="list-unstyled d-flex justify-content-between bg-light">
                        <div className="d-inline-flex p-2 leftItems fw-bolder">
                                <Link to="/">Home</Link>
                                <Link to="#">About</Link>
                                <Link to="#">Address</Link>
                                <Link to="#">News</Link>
                        </div>
                        
                        <div class="dropdown">
                                <button class="p-2 mx-2 border-0 dropdown-toggle bg-light text-primary" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false">
                                Login/Register
                                </button>
                                <ul class="dropdown-menu" aria-labelledby="dropdownMenuButton1">
                                        <li><a class="dropdown-item" href="#">Login</a></li>
                                        <li><a class="dropdown-item" href="#">Register</a></li>
                                </ul>
                        </div>  
                </div>
         );
}
 
export default Nav;
